// src/pages/Podcast.js
import React from 'react';
import Header from '../components/Header';
import Footer from '../components/Footer';

const Podcast = () => (
    <div>
      <Header />
      <main>
        <h1>Podcast Page</h1>
        <p>Welcome to the Podcast page!</p>
        {/* Add podcast content here */}
      </main>
      <Footer />
    </div>
  );

  export default Podcast;
